import unittest

p = 1000000007
limit = 100000

f = [1] * limit

for i in range(1, limit):
    f[i] = f[i - 1] * i % p

cnt = [{} for i in range(limit)]


def initialize(s):
    cnt[0][s[0]] = 1
    for i in range(1, len(s)):
        cnt[i] = cnt[i - 1].copy()
        cnt[i][s[i]] = cnt[i].get(s[i], 0) + 1


def findCharFreq(l, r, c):
    return cnt[r].get(c, 0) - cnt[l].get(c, 0)


def answerQuery(l, r, s):
    l -= 1
    singles = 0
    even = 0
    d = list()

    for c in set(s[l:r]):
        v = findCharFreq(l - 1, r - 1, c)
        if v == 1:
            singles += v
            continue

        divisor = v // 2

        if v % 2 == 0:
            even += v
        else:
            singles += 1
            even += v - 1
            divisor = (v - 1) // 2

        d.append(divisor)

    even = f[even // 2]

    for divisor in d:
        even = (even * pow(f[divisor], p - 2, p)) % p

    if singles == 0:
        singles = 1

    return (even * singles) % p


class TestStringMethods(unittest.TestCase):

    def test_a1(self):
        s = "madamimadam"
        initialize(s)
        self.assertEqual(answerQuery(4, 7, s), 2)

    def test_a2(self):
        s = "madamimadam"
        initialize(s)
        self.assertEqual(answerQuery(1, 11, s), 30)

    def test_b(self):
        s = "week"
        initialize(s)
        self.assertEqual(answerQuery(1, 4, s), 2)

    def test_c(self):
        s = "week"
        initialize(s)
        self.assertEqual(answerQuery(2, 3, s), 1)

    def test_d(self):
        s = "wwwwowwoowwwwwwwowowowwowwwwwwwwwwwwwwwwwwwwowwoowwwwwwwwowwowwwwwowwowwowwwowwwwwowowwwwwwwowwwwwww"
        initialize(s)
        self.assertEqual(answerQuery(53, 92, s), 4845)

    def test_e(self):
        s = "wwwwowwoowwwwwwwowowowwowwwwwwwwwwwwwwwwwwwwowwoowwwwwwwwowwowwwwwowwowwowwwowwwwwowowwwwwwwowwwwwww"
        initialize(s)
        self.assertEqual(answerQuery(52, 98, s), 8855)

    def test_f(self):
        s = "wwwwowwoowwwwwwwowowowwowwwwwwwwwwwwwwwwwwwwowwoowwwwwwwwowwowwwwwowwowwowwwowwwwwowowwwwwwwowwwwwww"
        initialize(s)
        self.assertEqual(answerQuery(30, 97, s), 1344904)

    def test_g(self):
        s = "wwwwowwoowwwwwwwowowowwowwwwwwwwwwwwwwwwwwwwowwoowwwwwwwwowwowwwwwowwowwowwwowwwwwowowwwwwwwowwwwwww"
        initialize(s)
        self.assertEqual(answerQuery(40, 41, s), 1)

    def test_h(self):
        s = "wwwwowwoowwwwwwwowowowwowwwwwwwwwwwwwwwwwwwwowwoowwwwwwwwowwowwwwwowwowwowwwowwwwwowowwwwwwwowwwwwww"
        initialize(s)
        self.assertEqual(answerQuery(100, 100, s), 1)

    def test_i(self):
        s = ""
        initialize(s)
        self.assertEqual(answerQuery(148, 99940, s), 832684578)


if __name__ == '__main__':
    unittest.main()
